import React, { useState } from "react";
import { createTrade } from "../api/TradesAPI";

const NewTrade = ({ onClose }) => {
  const [formData, setFormData] = useState({
    symbol: "",
    option_type: "CALL",
    strike_price: "",
    exp_date: "",
    entry_price: "",
    exit_price: "",
    contracts: "",
    entry_date: "",
    close_date: "",
    user_id: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  // Retrieve userId from localStorage
  const getUserId = () => {
    const userDataString = localStorage.getItem("user_data");
    if (!userDataString) {
      console.error("No user data found in localStorage");
      return null;
    }

    try {
      const userData = JSON.parse(userDataString);
      return userData.sub;
    } catch (error) {
      console.error("Error parsing user data:", error);
      return null;
    }
  };

  // Retrieve the userId
  const userId = getUserId(); //use this userId in the formData

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await createTrade(
        {
          ...formData,
          strike_price: parseFloat(formData.strike_price),
          entry_price: parseFloat(formData.entry_price),
          exit_price: formData.exit_price
            ? parseFloat(formData.exit_price)
            : null,
          contracts: parseInt(formData.contracts),
        },

        parseInt(formData.user_id) //this should be the userId taken from here:const userId = getUserId();
      );

      console.log("Success:", response);
      alert("Trade submitted successfully");
      onClose();
    } catch (error) {
      console.error("Error:", error);
      alert("Error submitting trade");
    }
  };

  return (
    <div className="modal">
      <div className="new-trade-container">
        <div className="header-card">
          <p className="title">New Trade</p>
          <p className="close-btn" onClick={onClose}>
            &times;
          </p>
        </div>
        <hr />
        <form onSubmit={handleSubmit} className="form-container">
          {/* this section should come prefiled with the userId taken from here:const userId = getUserId();*/}
          <label>
            <input
              type="text"
              placeholder="User"
              name="user_id"
              value={formData.user_id}
              onChange={handleChange}
              required
            />
          </label>
          <br />
          <label>
            <input
              type="date"
              placeholder="Entry Date"
              name="entry_date"
              value={formData.entry_date}
              onChange={handleChange}
              required
            />
          </label>
          <br />
          <label>
            <input
              type="text"
              placeholder="Symbol"
              name="symbol"
              value={formData.symbol}
              onChange={handleChange}
              required
            />
          </label>
          <br />
          <label>
            <select
              name="option_type"
              value={formData.option_type}
              onChange={handleChange}
              required
            >
              <option value="CALL">CALL</option>
              <option value="PUT">PUT</option>
            </select>
          </label>
          <br />
          <label>
            <input
              type="text"
              placeholder="Strike Price"
              name="strike_price"
              value={formData.strike_price}
              onChange={handleChange}
              required
            />
          </label>
          <br />
          <label>
            <input
              type="date"
              placeholder="Exp. Date"
              name="exp_date"
              value={formData.exp_date}
              onChange={handleChange}
              required
            />
          </label>
          <br />
          <label>
            <input
              type="text"
              placeholder="Entry Price"
              name="entry_price"
              value={formData.entry_price}
              onChange={handleChange}
              required
            />
          </label>
          <br />
          <label>
            <input
              type="text"
              placeholder="Exit Price"
              name="exit_price"
              value={formData.exit_price}
              onChange={handleChange}
            />
          </label>
          <br />
          <label>
            <input
              type="text"
              placeholder="QTY"
              name="contracts"
              value={formData.contracts}
              onChange={handleChange}
              required
            />
          </label>
          <br />
          <label>
            <input
              type="date"
              placeholder="Close Date"
              name="close_date"
              value={formData.close_date}
              onChange={handleChange}
            />
          </label>
          <br />
          <button type="submit">Add</button>
        </form>
      </div>
    </div>
  );
};

export default NewTrade;
